import { useState } from "react"
import axios from 'axios'

export const Sample=()=>{
    const[ob,setOb]=useState({
        "data1":"",
        "data2":0
    })
    const hey=(eve)=>{
        const{name,value}=eve.target
        setOb((old)=>{
            return{
                ...old,
                [name]:value
            }
        })
    }

    const yet=async()=>{
        const t = await axios.post(`http://localhost:8080/`,{params:{"alpha":ob.data1,"beta":ob.data2}})
        alert(t.data)
    }

    return(
        <>
            <input type="text" name="data1" value={ob.data1} onChange={hey} />
            <input type="text" name="data2" value={ob.data2} onChange={hey} />
            <button onClick={yet}>Submit</button>
        </>
    )
}
